import data from "./Data2";
import "./Content.css";
import Mainselect from "../selectpage/Mainselect";
import { Link } from "react-router-dom";
const Item = (props) => {
  const onselect = () => {
    <Mainselect />;
  };
  return (
    <div className="wrapper1">
      <div className="wrapper2">
        <div className="wrapper20">
          <div className="wrapper3" onClick={onselect}>
            <div className="shirt">
              <Link to="/bestItem">
                <img
                  src={data.properties[props.one].picture}
                  className="itemimg"
                />
              </Link>
            </div>
            <p className="txt">{data.properties[props.one].name}</p>
            <p className="txt">{data.properties[props.one].price}</p>
          </div>
          <div className="wrapper3">
            <div className="shirt">
              <img
                src={data.properties[props.two].picture}
                className="itemimg"
              />
            </div>
            <p className="txt">{data.properties[props.two].name}</p>
            <p className="txt">{data.properties[props.two].price}</p>
          </div>
        </div>
        <div className="wrapper20">
          <div className="wrapper3">
            <div className="shirt">
              <img
                src={data.properties[props.three].picture}
                className="itemimg"
              />
            </div>
            <p className="txt">{data.properties[props.three].name}</p>
            <p className="txt">{data.properties[props.three].price}</p>
          </div>
          <div className="wrapper3">
            <div className="shirt">
              <img
                src={data.properties[props.four].picture}
                className="itemimg"
              />
            </div>
            <p className="txt">{data.properties[props.four].name}</p>
            <p className="txt">{data.properties[props.four].price}</p>
          </div>
        </div>
      </div>
    </div>
  );
};
export default Item;
